    false,nt"url": null,nt"notes": "RAMPS_INDOT_IN is a line shapefile that
    contains all ramps in Indiana, provided by personnel of Indiana Department of Transportation
    (INDOT), Business Information and Technology Systems, GIS Mapping. The data set
    provided by INDOT was in an ESRI shapefile format and was named "RAMPS_INDOT_2005."
    RAMPS_INDOT_IN is attributed with segment length as well as an INDOT Locational
    Reference System (LRS) identification number. The following is excerpted from the
    metadata provided by INDOT for the source shapefile RAMPS_INDOT_2005.SHP: "Ramp
    systems for Indiana, including all segments of cloverleaf and other ramp systems.
    Ramps are considered non-participating in the Linear Reference System for Indiana
    and therefore have a routeflag of non-participating (N)."",nt"license_title":
